import React from 'react';

const FormGroupReserva = ({ label, children, htmlFor }) => {
  return (
    <div className="form-group">
      {label && <label htmlFor={htmlFor}>{label}</label>}
      {children}
    </div>
  );
};

export default FormGroupReserva;
